import Button from 'react-bootstrap/Button'
import BabysitterCard from './'

const Babysitters = ({babysitters}) => {
    let babysitterCards = babysitters.map(baby => {
        return (
            <Col sm="4">
                <BabysitterCard key={baby.id} babysitter={baby} removeBabysitter={this.removeBabysitter.bind(this)}/>
            </Col>
        )
    })

    return (
        <Container fluid>
            <Row>
                {babysitterCards}
